<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH2908</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic develops the professional skills required for students to practice as a speech pathologist with a particular focus on the knowledge and practical skills required to conduct assessment, arrive at differential diagnosis, and plan and carry out therapeutic intervention with people with voice and swallowing disorders. Through in-class tutorials and workshops students will have opportunities to practice taking case histories, making diagnoses and selecting intervention strategies for clients with voice and swallowing disorders. Through the use of instructional multimedia, students will gain practical skills in conducting perceptual analysis of voice and in analysing instrumental assessments of swallowing..  Additionally, students will undertake a structured fieldwork program where they will gain experience working with normally developing children to facilitate learning development.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

