<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH2908</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>The aim of this topic is to: &lt;ul&gt; &lt;li&gt; Develop students ability to determine the nature and extent of voice disorders through clinical and instrumentation-based diagnosis and analysis &lt;li&gt; Develop students ability to determine the nature and extent of swallowing disorders through clinical and instrumentation-based diagnosis and analysis  &lt;li&gt; Determine and conduct appropriate intervention for voice disorders &lt;li&gt; Determine appropriate intervention for swallowing disorders &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

