<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH2908</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>On completion of the topic students will be able to: &lt;ul&gt; &lt;li&gt; Describe and manipulate one’s own voice  &lt;li&gt; Apply a case-history proforma relevant to the voice and/or swallowing &lt;li&gt; Analyse and report on the vocal mechanism using tools for &lt;ul&gt;  &lt;li&gt; Perceptual &lt;li&gt; Acoustic and &lt;li&gt; Physiologic measurement &lt;/ul&gt; &lt;li&gt; Evaluate an individual's voice-related quality of life (QOL) using appropriate measures &lt;li&gt; Select and implement a range of voice therapy intervention techniques appropriately. &lt;li&gt; Describe, analyse and report findings from dysphagia assessment  &lt;li&gt; Determine and prioritize treatment goals  &lt;li&gt; Select appropriate intervention strategies to meet prioritized goals  &lt;li&gt; Promote healthy voice use and prevention of voice problems in specific groups (eg. in children, in noisy work places and in professional voice users)  &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

