<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH3901</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>Using a series of case studies and supported by lectures and workshops this topic introduces students to knowledge of the aetiology, nature, prognosis, mechanisms, course and management of acquired language disorders, especially aphasia. Specifically, the following areas will be addressed: &lt;ol&gt; &lt;li&gt;Comprehensive assessment of aphasia &lt;ul&gt;&lt;li&gt; Impact of aphasia on an individual's function, participation and quality of life &lt;li&gt; The appraisal and diagnosis of the residual communicative abilities &lt;li&gt; An analysis of spontaneous language/ conversational language&lt;/ul&gt; &lt;li&gt; Differential diagnosis&lt;ul&gt; &lt;li&gt; Aetiology: presence of aphasia or another acquired language disorder &lt;li&gt; Type and severity of aphasia &lt;li&gt; Concomitant disorders&lt;/ul&gt; &lt;li&gt; Neuropsychological / Psycholinguistic appraisal, diagnosis and intervention&lt;ul&gt; &lt;li&gt; Naming and word finding &lt;li&gt; Auditory comprehension of words &lt;li&gt; Reading and writing of words &lt;li&gt; Sentence comprehension &lt;li&gt; Sentence production&lt;/ul&gt; &lt;li&gt; Therapy oriented appraisal and diagnosis of aphasia&lt;ul&gt; &lt;li&gt; Candidacy for therapy  &lt;li&gt; Prognostic variables &lt;li&gt; Psycho-social status &lt;li&gt; Motivation of patient (significant others) for therapy &lt;li&gt; Response to specific therapy methods and techniques &lt;li&gt; The ability to learn&lt;/ul&gt; &lt;/ol&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

