<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH3901</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>The aim of this topic is to:&lt;ul&gt; &lt;li&gt; Provide an understanding of brain functioning, specifically in relation to language  &lt;li&gt; Provide an understanding of neuro/psycholinguistic models of language processing &lt;li&gt; Provide students with the knowledge and principles of aphasiology, which are essential for the assessment, diagnosis, prognosis, and treatment of aphasia &lt;li&gt; Familiarise students with the procedures of diagnosis and treatment within a psycholinguistic framework &lt;li&gt; Provide an understanding of the psychological, social, and functional aspects of aphasia. &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

