<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH3901</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>On completion of the topic, students will be able to:&lt;ul&gt; &lt;li&gt; Describe the broad components and functional anatomy of the language system &lt;li&gt; Describe the processes underlying language comprehension and production at word, sentence and discourse level &lt;li&gt; Describe the effects of normal aging on communication &lt;li&gt; Describe how issues related to bilingualism/second language acquisition may influence communication  &lt;li&gt; Describe the cognitive neuropsychological approach to understanding how language works &lt;li&gt; List common aetiologies for aphasia &lt;li&gt; Explain the main linguistic and non-linguistic features of aphasia and their impact on communicative abilities &lt;li&gt; Compare how the disorder is defined within the various current approaches in aphasiology   (e.g. psycholinguistic; stimulation; cognitive neuropsychological; functional / social) &lt;li&gt; Analyse the implications for assessment of the main approaches in aphasiology  &lt;li&gt; List the procedures used for assessment and diagnosis of aphasia &lt;li&gt; Explain the pros and cons for using a standard assessment battery in the diagnosis of aphasia &lt;li&gt; Compare the information about strengths and limitations yielded by commonly used language elicitation tasks &lt;li&gt; Compare and contrast the main treatment approaches used in aphasia (e.g. psycholinguistic; stimulation; cognitive neuropsychological; functional ) &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

