<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH3902</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic provides a firm theoretical knowledge about the assessment, diagnosis and management of acquired cognitive communication disorders that are associated with the various types of dementia, non-dominant hemisphere strokes and traumatic brain injury.   The focus of this topic is on the actual cognitive and linguistic rehabilitation programs for individuals with cognitive communication disorders. In addition, there will be an extension of the management strategies for aphasia specifically when alternative and augmentative communication is involved and in cases of bilingualism or multilingualism. Much of the content in this topic is presented using a case-based style of teaching where students work collaboratively to explore cases in small groups supported by lectures and workshops.   This topic is fully integrated with SPTH3906 which will introduce the practical clinical skills needed to manage cognitive communication disorders. By the end of this topic and related topics (SPTH3901, SPTH3905 and Motor Speech Disorders from year 2) you will have a firm theoretical and practical understanding of the assessment, differential diagnosis and management of adult acquired speech, language and cognitive communication</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

