<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH3903</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>On completion of this topic, students will be able to:&lt;ul&gt; &lt;li&gt; Demonstrate 'novice' to 'intermediate' level competence in the practical skills taught and practiced during the academic teaching program and practicum &lt;li&gt; Demonstrate progression in their ability to manage workplace tasks.  Students may manage  2 - 4 client sessions per day, or equivalent degree of participation in a group intervention model &lt;li&gt; Develop practical skills in &lt;ul&gt; &lt;li&gt; Generic professional competencies of Reasoning, Communication, Lifelong Learning and Professionalism &lt;li&gt; Occupational competencies of Assessment, Analysis and Interpretation, Planning Intervention and Intervention&lt;/ul&gt; &lt;li&gt; Take responsibility for implementation of management plans with familiar clients &lt;li&gt; Apply theory to practice with a range of clients with communication disorders &lt;li&gt; Be actively involved in the management of clients presenting with communication difficulties under a high level of guidance and support by a speech pathology clinical educator &lt;li&gt; Contribute to planning of client management in conjunction with their clinical educators and peers &lt;li&gt; Relate theory to practice. &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

