<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH3904</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>On completion of this unit, students will:&lt;ul&gt; &lt;li&gt; Develop practical skills in &lt;ul&gt; &lt;li&gt; Generic professional competencies of Reasoning, Communication, Lifelong Learning and Professionalism  &lt;li&gt; Occupational competencies of Assessment; Analysis and Interpretation; Planning of Speech Pathology Intervention, Speech Pathology Intervention; Planning, Maintaining and Delivering Speech Pathology Services; Professional, Group and Community Education and Professional Development &lt;/ul&gt; &lt;li&gt; Take responsibility for implementation of management plans with clients &lt;li&gt; Apply theory to practice with a range of clients with communication disorders &lt;li&gt; Independently undertake routine or familiar aspects of general management with a small number of clients presenting with communication and/or swallowing difficulties with moderate guidance and supervision of a speech pathology clinical educator &lt;li&gt; Independently plan familiar/routine aspects of client management in conjunction with their peers and moderate supervision from their clinical educator &lt;li&gt; Take increased responsibility for determining procedures and rationales with a familiar client group, as well as more independently implement clinical management techniques &lt;li&gt; Relate theory to practice. &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

