<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH3905</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic covers acquired communication disorders in adults, children with complex communication and mealtime/feeding needs and counselling. Students are provided with the knowledge and practical skills required to conduct assessment, differential diagnosis, and management of individuals with acquired language disorders, primarily aphasia. Students also focus on complex communication and feeding disorders in children via tutorials and a series of workshops to develop practical observation, analysis and evaluation skills to assess young children and plan appropriate management in partnership with families and other professional groups. Over several sessions, students also learn the principles of and strategies for counselling clients and their families/carers.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

