<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH3905</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>The aim of this topic is to:&lt;ul&gt; &lt;li&gt; Facilitate development of professional knowledge, attitudes and practice in preparation for professional placements &lt;li&gt; Begin to develop students’ skills relevant to speech pathology practice with complex communication or swallowing disorders, namely to determine the nature and extent of the disorders through careful diagnosis and analysis and determine appropriate intervention &lt;li&gt; Introduce the concept of quality improvement/assurance  &lt;li&gt; Introduce what is meant by having an ethic of care &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

