<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH3905</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>On completion of this unit, students will be able to: &lt;ol&gt;&lt;li&gt;Analyse the impact of complex communication impairment (paediatric or adult) and/or feeding/mealtime issues on an individual’s communication, life participation and psychosocial well-being &lt;li&gt;Experiment with various assessment tools and evaluate an individual’s linguistic and non-linguistic strengths and weaknesses &lt;li&gt;Formulate a client-centred treatment plan based on client preference, assessment results and best practice evidence &lt;li&gt;Practice implementation of various therapy techniques and reflect on skills &lt;li&gt;Devise contingencies for intervention justifying when and why they are needed &lt;li&gt;Demonstrate a basic application of the principles of effective therapeutic communication and basic counselling in their speech pathology practice (including awareness of nonverbal behaviour, reflective listening, open ended questions, appropriate responding,  range of models of counselling, principals involved in facilitating change, awareness of issues related to loss, grief and bereavement) &lt;li&gt;Reflect on their own emotional responses to clients with psychological, behavioural or mental health issues and identify how best to seek support and guidance from clinical supervisors and academic staff&lt;/ol&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

