<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH3906</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>The aim of this topic is:&lt;ol&gt; &lt;li&gt;To understand and be able to apply the Ethical principles that guide speech pathology professional practice. &lt;li&gt;To understand the role of the speech pathologist in working with individuals with communication and swallowing needs at different times in their journey, including the role of the speech pathologist in working with individuals in the terminal phase of their life. &lt;li&gt;To introduce students to those psychosocial or mental health issues that may contribute to or arise in association with a range of communication and/or swallowing problems. &lt;li&gt;To encourage students to reflect on their own emotional responses to clients and their families who are experiencing complex issues and identify how best to seek support and guidance from clinical supervisors and academic staff</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

