<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH3907</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>The topic aims to:&lt;ul&gt; &lt;li&gt; Provide students with the theoretical knowledge to understand a range of complex communication and feeding disorders in children.  &lt;li&gt; Review evidence-based speech pathology research and practice regarding appropriate evaluation and intervention approaches.  &lt;li&gt; Facilitate students' understanding of the theory, principles and practice of applying Augmentative and Alternative Communication solutions for individuals with complex communication needs. &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

