<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH3907</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>On completion of this topic students will be able to:&lt;ul&gt; &lt;li&gt; Describe factors that influence development of oral and pharyngeal control for swallowing (e.g. motor development, sensory experiences, cognition, communication, psychosocial development, nutrition; medical) &lt;li&gt; Provide an overview of the nature, causes, maintaining factors, opportunities and barriers in clients with complex communication and feeding needs  &lt;li&gt; Identify related impacts upon safety, nutrition and hydration and a child’s learning and behaviour that may arise from a feeding or communication problem &lt;li&gt; Describe the process involved in evaluation of feeding / communication difficulties (e.g. case history taking; clinical assessment; instrumental assessment; Quality of Life) &lt;li&gt; Take a systems approach to describe, interpret, analyse and report findings from assessment, integrating scores with client's performance/behaviour &lt;li&gt; Compare and contrast suitable Augmentative and Alternative Communication designs and features for a specific client (e.g. communication boards, symbols; signing; technology) &lt;li&gt; Determine and prioritize treatment goals   &lt;li&gt; Select appropriate intervention strategies to meet prioritized goals  &lt;li&gt; Identify resources and strategies that would be relevant to supporta child's learning and behavioural development. &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

