<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH3908</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic provides students with the theoretical knowledge to understand a range of complex communication and swallowing disorders in adults. In particular, evidence-based speech pathology research and practice are reviewed regarding appropriate evaluation and intervention approaches. Over an intensive 7 week period students will be provided with lecture and case-based learning opportunities that introduce them to the broad and diverse parameters of  communication and swallowing disorders in Australian and international contexts.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

