<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH3908</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>The aim of this topic is to:&lt;ol&gt;  &lt;li&gt;Provide students with the theoretical knowledge to understand a range of complex communication and swallowing disorders in adults.  &lt;li&gt;Review evidence-based speech pathology research and practice regarding appropriate evaluation and intervention approaches.  &lt;li&gt;Introduce students to the broad and diverse parameters of communication and swallowing disorders in Australian and international contexts.  &lt;li&gt;To investigate client centred practices and client lead goal setting when working within an interprofessional rehabilitation framework. &lt;li&gt;To develop an integrated understanding of how concepts integral to the ICF can be used to support the design and delivery of speech pathology services for individuals with complex communication and swallowing needs. &lt;li&gt;To facilitate students’ understanding of the theory, principles and practice of working with adult clients with acquired communication disability to develop Augmentative and Alternative Communication solutions as part of a range of possible interventions.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

