<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH3908</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>On completion of this unit, students will:&lt;ol&gt; &lt;li&gt;Use the Ottawa Charter &amp; International Classification of Function as a basis for describing the impact of communication and swallowing impairment on levels of activity and participation &lt;li&gt;Discuss the role of speech pathologists and other professionals involved in the interprofessional management of a client with complex communication and swallowing disorders &lt;li&gt;Examine and apply current models of best practice in assessment and intervention for a client with complex communication and/or swallowing needs &lt;li&gt;Devise assessment recommendations that will enable demonstration of change in an individual’s communication or swallowing skills in response to treatment (outcome measures; treatment efficacy) &lt;li&gt;Explain how a speech pathologist would involve the client/family in the decision-making process related to their care &lt;li&gt;Devise an integrated rationale for determining and prioritising intervention goals for adults with complex needs  &lt;li&gt;Apply the principles of quality Augmentative and Alternative assessment and design to the selection of communication options for adults with complex needs.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

