<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH4720</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>Clinical Skills and Practice 4 is delivered via a series of workshops across the semester – 3 short (2 hour) sessions and a three day intensive. During this capstone topic students will reflect on their course and determine how they could demonstrate that they have achieved the Flinders Graduate Qualities. They will also discuss aspects of their clinical placements which have been especially challenging, such as ethical dilemmas in client management or inequities in access to services. Working in groups they will either develop a community education project to address an area of need they have identified while on clinical placement or contribute to the development or provision of services in an area of need.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

