<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH4720</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>The aim of this topic is to:&lt;ul&gt; &lt;li&gt; Provide students with an opportunity to review their educational experience in the context of contemporary health and education policy and practice. &lt;li&gt; Facilitate exploration of a range of professional issues which relate directly to practice as a speech pathologist, and the transition from student to clinician.   &lt;li&gt; Assist students to reflect on clinical practical experience as a student, and to begin to look forward to a career as a speech pathologist.   &lt;li&gt; Examine primary health care models of service delivery &lt;li&gt; Facilitate integration of factors relating to the social determinants of health  &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

