<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH4720</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>On completion of this topic, students will be able to:  	&lt;ul&gt; &lt;li&gt; understand the role of Competency Based Occupational Standards (2011) in the maintenance of minimum standards for the profession 	&lt;li&gt;identify their clinical strengths and weaknesses and strategies for their own continued professional development (GPC Unit 3) 	&lt;li&gt;reflect on their transition from student to Entry Level professional and their developing professional identity (GPC Unit 3, 4) &lt;li&gt;	discuss models of service delivery, their application, and the possible constraints to the implementation of different models in different workplaces (CBOS Unit 5) 	&lt;li&gt;discuss the major concepts of ethics, and have developed strategies for dealing with ethical issues arising in clinical practice (GPC Unit 4; CBOS Unit 7) 	&lt;li&gt;develop skills in mentoring speech pathology students with less clinical experience than themselves (CBOS Unit 6) &lt;li&gt;	reflect on the Flinders Graduate Qualities, and how they have achieved these qualities across the Speech Pathology program (GPC Units 1-4).  &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

