<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH4901</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3> On completion of this topic, students will:&lt;ul&gt; &lt;li&gt; Demonstrate entry level practical skills as indicated by the scoring of the COMPASS™ by the Clinical Education Coordinator in the following areas:&lt;ul&gt; &lt;li&gt; Generic professional competencies of Reasoning, Communication, Lifelong Learning and Professionalism &lt;li&gt; CBOS competencies of Assessment, Analysis and Interpretation, Planning of Speech Pathology Intervention and Speech Pathology Intervention&lt;/ul&gt; &lt;li&gt; Participate in generic professional tasks e.g. community education, case mix, quality assurance &lt;li&gt; Take responsibility for implementation of management with clients &lt;li&gt; Independently undertake routine or familiar aspects of assessment, diagnosis and/or general management with clients presenting with communication and/or swallowing difficulties with low guidance and supervision of a speech pathology clinical educator &lt;li&gt; Explain the role of Competency Based Occupational Standards in the maintenance of minimum standards for the profession &lt;li&gt; Identify their clinical strengths and weaknesses and strategies for their own continued professional development. &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

