<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH4902</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>The emphasis of Speech Pathology Practicum 4 is on the practical application of the theory gained across the program in a block placement within a workplace. This unit will further facilitate students' understanding and application of client management, through practical experience with clients presenting with a range of communication and swallowing difficulties.  The topic integrates a Community Education/Health promotion project, enabling students to examine primary health models of service delivery, and facilitating integration of factors relating to the social determinants of health.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

