<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH4902</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>The aim of this topic is to:&lt;ul&gt; &lt;li&gt; Further facilitate students' understanding and application of client management, through practical experience with clients presenting with a range of communication and swallowing difficulties.   &lt;li&gt; Assist students to demonstrate Entry Level competency as assessed by COMPASS®. &lt;li&gt; Prepare students for workplace context and the job application process through completing a Speech Pathology job application. &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

