<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH4902</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>On completion of this unit, students will:&lt;ul&gt; &lt;li&gt; Demonstrate competence in all aspects of speech pathology practice sufficient to enter the profession &lt;li&gt; Demonstrate entry level practical skills in &lt;ul&gt; &lt;li&gt; Generic professional competencies of Reasoning, Communication, Lifelong Learning and Professionalism &lt;li&gt; CBOS competencies of Assessment, Analysis and Interpretation, Planning of Speech Pathology Intervention and Speech Pathology Intervention, Planning, Maintaining and Delivering Speech Pathology Services, Professional, Group and Community Education and Professional Development &lt;/ul&gt; &lt;li&gt; Take independent responsibility for aspects of speech pathology practice unless the situation is new or a number of features of the client and/or workplace combine to create complexity &lt;li&gt; Relate theory to practice &lt;li&gt; Understand the process involved in applying for a Speech Pathology position, and address the Essential and Desirable criteria of a Speech Pathology Job and Person Specification. &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

