<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH7000A</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>SPTH7000A Honours Thesis A and SPTH7000B Honours Thesis B are taught and assessed as a continuum and students must undertake both in the same academic year. Students will develop practical research skills and knowledge in a designated research area within speech pathology, audiology, linguistics, psychology, physiology or a related discipline by conducting an honours project, leading to the submission of a thesis.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

