<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH7000B</ns1:in1><ns1:in2>assessment</ns1:in2><ns1:in3>On completion of 7000A and B a thesis will be submitted not exceeding 15,000 words in length. An introductory and progress seminar of 15 minutes each will have been presented and a final 45 minute presentation. A vive voce of 15 minutes will provide an opportunity for the student and examiners to clarify aspects of the thesis and presentation allowing the examiners to revise the grade upwards if appropriate. The overall grade for the combined topics will be determined by the thesis (75%) and the final presentation (25%).</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

