<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH7000B</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>This topic aims to prepare graduates who will be critical consumers of research, and who will be able to design, conduct, and write up a research project themselves. It will provide knowledge and skills relevant to conducting research, especially for entry to higher degree courses, and develop an advanced level of knowledge in the area of specialisation. It will also further develop verbal and written skills relevant to advanced studies.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

