<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH7000B</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>On completion of this topic, students will: &lt;ul&gt; &lt;li&gt; Demonstrate the ability to communicate scholarly material effectively both orally and in written form &lt;li&gt; Define and apply a major research paradigm to a well formulated research question &lt;li&gt; Critique research and scholarly literature for the strengths and weaknesses in their conception, design, analysis, and presentation &lt;li&gt; Apply a rigorous research analysis to data, effectively synthesise and communicate results/findings  &lt;li&gt; Effectively conduct and communicate a rigorous research process, from development of a research question through design, data collection, and analysis, to write-up and publication &lt;li&gt;Demonstrate an advanced level of knowledge in the area of specialisation &lt;li&gt; Manage contingencies, identify how they have influenced research outcomes and make recommendations for future research projects. &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

