<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH7003</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>On completion of this topic, students will: &lt;ul&gt; &lt;li&gt; Demonstrate the ability to critically evaluate and transform knowledge to competently engage in semi-autonomous professional practice in all aspects of speech pathology service delivery.  &lt;li&gt; Demonstrate the ability to solve complex professional problems through the recruitment and integration of skills recognised by the professionals including: &lt;ul&gt; &lt;li&gt;Generic professional competencies of Reasoning, Communication, Lifelong Learning and Professionalism &lt;li&gt; Competency Based Occupational Standard competencies of Assessment, Analysis and Interpretation, Planning of Evidence Based Speech Pathology Practices, Implementation of Speech Pathology Practices, Planning, Providing and Managing Speech Pathology Services, Professional and Supervisory Practice, Lifelong learning and reflective practice.&lt;/ul&gt; &lt;li&gt; Take independent responsibility for aspects of speech pathology practice unless the situation is new or a number of features of the client and/or workplace combine to create complexity &lt;li&gt; Have reflected on the Flinders Graduate Qualities, and how they have achieved these qualities across the Speech Pathology program. &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

