<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH7906</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>On completion of this topic, students will  be able to; &lt;ul&gt; &lt;LI&gt; Critically evaluate the literature to justify an area of research, develop a specific research question with well justified and ethical methodology. &lt;li&gt;  Analyse and report findings from assessment of complex communication and swallowing disorders in adults. &lt;li&gt;  Use assessment findings to generate client centred solutions that meet the needs of a client with a complex communication or swallowing disorders.  &lt;li&gt; Effectively explain complex information to clients/carers.  &lt;li&gt; Critically evaluate the impact of psychosocial and mental health issues on clients and their families on their engagement with intervention and develop effective management strategies. &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

