<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9120</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>In this topic students will build on the introductory work they have done on critical thinking, scientific inquiry and evidence-based practice to further their understanding of how clinical research can be designed, conducted and evaluated. The process of  constructing scientifically answerable questions and hypotheses will be explored, concepts of experimental and non-experimental research introduced and selection of appropriate methodology(s) to answer research questions discussed. The relationship of research design with evidence-based practice principles will be elaborated. In addition, the four core academic abilities will be developed to an early intermediate level: Reasoning; Professional Communication; Lifelong Learning; and Professional Role.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

