<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9120</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>This topic aims to ensure that students can understand, critique and apply research methodology such that they are informed consumers of research to inform their clinical practice and are able to develop an understanding of themselves as clinician-researchers.  Foundational research knowledge and skills that will be addressed include:&lt;ul&gt; &lt;li&gt; Formulating research questions and hypotheses &lt;li&gt; Selecting appropriate experimental and non-experimental research designs to test hypotheses &lt;li&gt; Designing and conducting clinical research;  &lt;li&gt; Relating research design to evidence-based practice principles. &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

