ERROR - 2017-10-12 08:57:41 --> <?xml version="1.0" encoding="UTF-8"?>
<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9121</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>Professional Studies and Communication Sciences 1 is a foundation topic that introduces students to normal development across the lifespan, and the knowledge and skills related to the sciences of anatomy and physiology in relation to human communication and swallowing processes, phonetics, linguistics, research methods and scientific inquiry, and clinical practice. These key concepts and skills prepare students for their first clinical experiences, effective participation in PBL and research inquiry.    Anatomy concepts will include an introduction to the functional anatomy and physiology of the phonatory, articulatory, and respiratory systems including embryology and the anatomy of the head and neck. Phonetics and linguistics will introduce students to concepts of speech, language, and prosody as well as phonetic transcription, morphology and grammar. Research methods concepts include the role of critical and scientific inquiry and thinking in speech pathology, evidence based practice and introductory statistics required to score and interpret formal speech pathology assessments.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

