ERROR - 2017-10-12 08:57:41 --> <?xml version="1.0" encoding="UTF-8"?>
<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9121</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>This topic aims to ensure that students have an understanding of normal development across the lifespan, and can apply foundational knowledge and skills required to engage effectively in problem based learning and clinical placements in semester 1. This aim will be applied to the following foundational speech pathology sciences of: &lt;ul&gt; &lt;li&gt; Anatomy and physiology including embryological development related to communication and swallowing &lt;li&gt; Phonetics and linguistics with regard to how humans express and understand each other through speech, phonology, language, and prosody &lt;li&gt; Scientific inquiry and thinking in speech pathology including evidence based practice, basic research principles such as observation and scientific reasoning, and basic statistical techniques required for using standardized tests and measurements in speech pathology.&lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

