ERROR - 2017-10-12 08:57:41 --> <?xml version="1.0" encoding="UTF-8"?>
<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9122</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>This topic introduces students to the profession of speech pathology, and the knowledge and skills specific to the practice of the profession. It aims to provide students opportunities to develop their academic abilities in relation to speech pathology practice and their knowledge and practical skills regarding the application of:&lt;ul&gt; &lt;li&gt; Speech Pathology management of clients who have communication and/or swallowing difficulties &lt;li&gt; Generic professional competencies of Communication, Reasoning, Behaviour and Lifelong Learning &lt;li&gt; Occupational competencies of Assessment, Analysis and Interpretation, Planning Speech Pathology Intervention, Speech Pathology Intervention, Planning, Maintaining and Delivering Speech Pathology Services, Professional, Group and Community Education and Professional Development. &lt;/ul&gt; Speech pathology skills will include those required for managing paediatric populations, intervention and assessment strategies, and working in teams.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

