<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9123</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>Through a Problem Based Learning methodology, students will develop a beginning understanding of the key areas of professional practice as laid down in the Competency-Based Occupational Standards (CBOS) for Speech Pathologists: speech, voice, language, fluency, swallowing and hearing. They will consider the broader issues of lifespan development and the impact of the social context on health. They will develop skills in two of the course’s core academic abilities: reasoning and critical thinking, and effective professional communication. This topic introduces essential understandings for students’ clinical placements which commence in this semester.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

