<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9123</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3> This topic has three key aims:&lt;ul&gt; &lt;li&gt; To facilitate for students a broad understanding of the current  knowledge, theories, methodology and research in the area of Speech Pathology as laid down in the Competency Based Occupational Standards (CBOS) for Speech Pathologists &lt;li&gt; To introduce students to the broader issues of lifespan development and the impact of the social context on health &lt;li&gt; To foster students' thinking and communication skills and practices in order to stimulate critical thinking and questioning about methodology and practice in the research and practice community. &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

