<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9123</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>On completion of this topic, students will be expected to:&lt;ul&gt; &lt;li&gt;  Develop understandings of the foundation sciences relevant to speech pathology practice including anatomy, physiology, phonetics and linguistics &lt;li&gt; Relate theory to observations in clinical practice &lt;li&gt;  Appreciate the impact of the social context on health at a range of levels &lt;li&gt;  Problem-solve in collaboration with their peers &lt;li&gt; Analyse and interpret case studies using problem-based learning protocols &lt;li&gt; Demonstrate graduate abilities in working both independently and collaboratively, valuing ethical behaviour, and application of knowledge &lt;li&gt; Show effective communication and social interaction with peers and other professionals. &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

