<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9124</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3> This topic aims to provide students with opportunities to develop knowledge and practical skills in relation to:&lt;ul&gt; &lt;li&gt; Speech Pathology management of clients who have communication and/or swallowing difficulties &lt;li&gt; The key generic competencies required for speech pathology practice detailed in the COMPASS® (SPA 2006) together with the complementary Academic Abilities of Reasoning, Professional Communication, Lifelong Learning, and Professional Role &lt;li&gt; Develop occupational competencies of Assessment, Analysis and Interpretation, Planning Speech Pathology Intervention, Speech Pathology Intervention, Planning, Maintaining and Delivering Speech Pathology Services, Professional, Group and Community Education and Professional Development.&lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

