<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9124</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>On completion of this topic, students will be expected to be able to:&lt;ul&gt; &lt;li&gt; Demonstrate minimum competence in the practical skills taught and practised during clinical skills tutorials &lt;li&gt; Demonstrate progression in their ability to handle workplace tasks in management of 2-4 client sessions per day, either individually, in pairs, or through a group intervention model  &lt;li&gt; Demonstrate intermediate level practical skills in the generic professional competencies, academic abilities, and occupational competencies of assessment, analysis and interpretation, planning intervention and intervention &lt;li&gt; Take responsibility for implementation of management plans with familiar clients &lt;li&gt; Appreciate how theory relates to practice &lt;li&gt; Take responsibility for the assessment, diagnosis and general management of a small number of clients presenting with communication and/or swallowing difficulties under a moderate level of guidance by clinical educator &lt;li&gt; Independently plan familiar/routine aspects of client management in conjunction with peers and moderate supervision from their clinical educator.&lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

