<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9125</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>In this topic students will build on their understanding of the key areas of knowledge in speech pathology and make diagnoses and recommend simple treatments related to the key areas of professional practice. Two themes are interrelated: lifespan development and social context and its impact on health. In addition, the four core academic abilities are developed to an intermediate level: Reasoning; Professional Communication; Lifelong Learning; and Professional Role. Both content and skill development such as effective communication and social interaction are undertaken through problem based learning.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

