<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9126</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic focuses on developing and applying skills and knowledge required to provide services to clients who are experiencing communication and/or swallowing difficulties. Content and skill development is addressed through a combination of independently undertaking routine or familiar aspects of speech pathology practice, with guidance and supervision of a speech pathology clinical educator and participating in clinical skills tutorials. The seven key competencies required for speech pathology practice, and defined by the Competency Based Occupational Standards - Entry Level (CBOS) [SPAA, 2001] document will be targeted. The four core academic abilities will be developed: Reasoning; Professional Communication; Lifelong Learning; and Professional Role.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

