<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9126</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>This topic aims to: &lt;ul&gt; &lt;li&gt; provide students with opportunities to develop their academic abilities in relation to speech pathology practice &lt;li&gt; to develop their knowledge and practical skills regarding the application of Speech Pathology managementof clients who have communication and/or swallowing difficulties &lt;li&gt; to build generic professional competencies of Communication, Reasoning, Behaviour and Lifelong Learning &lt;li&gt; to develop the occupational competencies of Assessment, Analysis and Interpretation, Planning Speech Pathology Intervention, Speech Pathology Intervention, Planning, Maintaining and Delivering Speech Pathology Services, Professional, Group and Community Education and Professional Development. &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

