<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9127</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic is one of three strands in the course – Professional Studies and Communication Sciences, Speech Pathology Skills and Practice and Research. It covers the key areas required for entry level to professional practice according to Competency Based Occupational Standards (CBOS) for Speech Pathologists. Using problem based learning, complex issues and case studies that cover multiple range indicators (for example, cases that have speech, voice and swallowing issues together) are undertaken. The interrelated themes of lifespan development and social context continue. The four core academic abilities will be developed to advanced levels: Reasoning; Professional Communication; Lifelong Learning; and Professional Role.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

