<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9127</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>This topic aims to develop students' understanding of the following areas to a professional level:&lt;ul&gt; &lt;li&gt; Complex issues and case studies that cover multiple range indicators in the key areas of professional practice (speech, voice, language, fluency, swallowing and, in addition, hearing &lt;li&gt; The broader issues of lifespan development and the impact of the social context on health &lt;li&gt; Psychosocial issues and ethical dilemmas &lt;li&gt; The core academic abilities of reasoning and professional communication. &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

