<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9127</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>On completion of this topic, students will be expected to:&lt;ul&gt; &lt;li&gt; Demonstrate complex understandings of the anatomy and physiology, phonetics and linguistics related to the six key professional areas &lt;li&gt; Demonstrate the capacity to make decisions that take into account the complexity of speech pathology problems &lt;li&gt; Recommend strategies for action &lt;li&gt; Evaluate the effectiveness of intervention plans &lt;li&gt; Demonstrate an appreciation of complex decision-making process in complex clinical cases where psychosocial and ethical issues may impact on intervention. &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

