<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9128</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic focuses on consolidating skills and knowledge required to provide services to clients who are experiencing communication and/or swallowing difficulties. Content and skill development is addressed through a combination of undertaking aspects of speech pathology practice, working with clients under the supervision of a speech pathologist clinical educator and participating in an intensive workshop on completion of the semester. The seven key competencies required for speech pathology practice, and defined by the Competency Based Occupational Standards – Entry Level (CBOS) [SPAA, 2001] document will be targeted. The four core academic abilities will be developed: Reasoning; Professional Communication; Lifelong Learning; and Professional Role.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

