<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>SPTH9220</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>In this topic students develop the knowledge and skills required for evidence-based practice in speech pathology. Students will partner with clinicians to formulate an answerable clinical question. Once the question is determined, they will search for the current best evidence, critically appraise the evidence, synthesise it and make recommendations about practice based on the integration of client/family values, clinical expertise and research evidence.  This will be presented within an evidence-based practice framework.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

