<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>THEO1204</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic introduces the central issues raised through a critical study of one of the Synoptic gospels (Mark, Matthew or Luke) including its sources, provenance and distinctive theology. Through a range of exegetical methods, the topic will look at the literary design of the specified Gospel situated in the broader cultural and sociological context of the first century CE. The contemporary missional and pastoral implications of that Gospel will also be explored.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

