<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>THEO1401</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic will introduce students to the study of church history from the first century to 1500CE. It will consider the impact of perspective on the recounting and analysis of history, the sources that are available and the relevance of history to contemporary life. The topic will examine the beginnings of the church, the writings, context and debates of some of the early church fathers and mothers and councils.  It will follow the expansion of the church from North Africa, the Middle East and Eastern Europe west toward Britain and east toward China, and chart the rise of mysticism, monasticism and medieval Christianity and the factors contributing to Reformation.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

