<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>THEO1401</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>The aims of this topic are to: &lt;ul&gt;&lt;li&gt;introduce students to a consideration of what 'history' actually is and why it is important to study it&lt;li&gt;investigate the sources that inform our understanding of the past and explore how those sources may have been interpreted in both the past and in the present&lt;li&gt;explore the development of Christianity in the Roman Empire from the end of the new testament period to the middle of the 5th Century&lt;li&gt;trace the expansion of Christianity beyond the borders of the Roman Empire to Britain, northern and eastern Europe, North Africa and Asia&lt;li&gt;consider the main movements within Christianity before the Reformation, including monasticism and mysticism&lt;/li&gt;&lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

