<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>THEO1401</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>At the conclusion of this topic students will be able to: &lt;ul&gt;&lt;li&gt;outline and describe the development of Christianity from the last part of the 1st Century to 1500 CE&lt;li&gt;display skill in interpreting primary source material and evaluating its significance&lt;li&gt;demonstrate competence in evaluating the arguments and theories put forward by different historians&lt;li&gt;pursue independent research and present the result in essay format&lt;/li&gt;&lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

