<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>THEO2411</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic considers the varieties of functions which deacons have exercised through the centuries and, in particular, the formative centuries in which the ministry was shaped. Special attention is given to the renewal of the diaconate in the 19th and 20th Centuries in the Lutheran, Anglican, Reformed and Methodist traditions, and to restoration of the permanent diaconate in the Anglican, Orthodox and Roman Catholic churches. The recent widening of diaconal ministry in the Uniting Church in Australia will also be examined.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

