<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>THEO3217</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic is a study tour of the Middle East, prepared for by two day-long seminars and independent study. The aim is for students to gain an appreciation of the religious, political, economic and cultural milieu of Ancient Israel, and of Jesus and his followers in the first century. Through study in situ participants will become familiar with the geography and archaeology of Israel and the Middle East and develop an understanding of the milieu in which the Old and New Testaments were written.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

