<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>THEO3217</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>The aims of this topic are to: &lt;ul&gt;&lt;li&gt; gain an appreciation of the cultural milieu of the Mediterranean world in which the Bible was written&lt;li&gt;appreciate ancient and early Christian sites which will illuminate participants' intelligent reading of the biblical texts and early Church documents&lt;li&gt; identify the different cultural scripts of contemporary Westerners and ancient circum-Mediterranean people&lt;li&gt; learn about the geography and history of the Bible&lt;li&gt;appreciate the different faith and cultural communities in the Middle East&lt;li&gt;to understand and map the growth of early Christianity &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

