<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>THEO8202</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic introduces students to foundational issues of Synoptic Studies, including sources, provenance and distinctive theologies, through a critical study of one of the Synoptic Gospels (Mark, Matthew or Luke). Through the application of a variety of exegetical methods, the topic will evaluate the interrelationship and literary design of the gospels and analyse them in their broader cultural and sociological contexts. The hermeneutical aspects of interpreting these ancient texts in contemporary cultural contexts will be critically evaluated.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

