<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>THEO8204</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic will introduce the fundamentals of New Testament study, including an introduction to contemporary interpretation of the New Testament by reading it as a collection of different kinds of literature and by exploring the historical, cultural and social backgrounds of the New Testament writings.   Students will develop skills in the exegesis of biblical texts and explore some of the issues surrounding the application of the ancient writings to contemporary contexts. A series of incremental themes will be covered during the semester, presenting both an overview of the literature and specific study of representative sections of biblical material. The topic will include the Gospels and Acts, and Pauline Writings, and may include other Christian approaches to the Judaic heritage (Hebrews, James, Revelation) and Issues of canon and authority.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

