<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>THEO8207</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>This topic aims to: &lt;ul&gt;&lt;li&gt;analyse the cultural milieu of the Mediterranean world, in which the Bible was written, critically &lt;li&gt;evaluate ancient and early Christian sites and analyse their contributions to the reading of the biblical texts and early Church documents &lt;li&gt;provide foundational theoretical skills to understand and map the growth of early Christianity  &lt;li&gt;identify and evaluate the different cultural scripts of ancient circum-Mediterranean people and contemporary Westerners  &lt;li&gt;develop skills to identify and analyse contributions of the different faith and cultural communities in the Middle East</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

