<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>THEO8401</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic will provide students with foundational skills and knowledge for the study of church history from the first century-1500CE. It will begin by evaluating the impact of perspective on the recounting and analysis of history, the sources that are available to us and the need to pay attention to history for the lessons it can teach us today.   The topic will then examine critically the beginnings of the church, the writings, context and debates of some of the early church fathers and mothers and councils, follow the expansion of the church from North Africa, the Middle East and Eastern Europe west toward Britain and east toward China, and chart the rise of mysticism, monasticism and medieval Christianity and the factors contributing to Reformation.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

