<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>THEO8401</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>This topic aims to: &lt;ul&gt;&lt;li&gt;enable students to evaluate critically the way in which our reception of history and the lessons it has to offer is influenced by those who write and speak it and thus also the ways in which we choose to apply it &lt;li&gt;provide foundational knowledge of the main ideas, events, people, concepts, theology, mission and spirituality of Christians from the first century-1500 CE,  &lt;li&gt;critically analyse the lessons contained within this period of history for Christians and church communities in Australia today</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

