<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>THEO8505</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic provides the foundational study in a particular aspect of Christian ministry and mission in relation to religious practices in the churches and contemporary society. It includes the analysis of the historical and theological foundations of the practice of ministry, and the contributions of the social sciences. The topic includes analysis of contemporary practice in relation to the above disciplines, and orientation to the understandings and approaches that underlie such practice in particular contexts. This topic will be offered with particular foci, such as liturgy, mission, homiletics, pastoral care, or Christian education.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

