<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>THEO9033</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>The aims of this topic are to: &lt;ul&gt;&lt;li&gt;investigate the history of biblical interpretation and some of the philosophical underpinnings of that history, including hermeneutical theory &lt;li&gt;examine the shifts in methodologies and perspectives that have taken place since the mid 20th Century &lt;li&gt;investigate theoretical approaches to scripture and the methods used in these approaches &lt;li&gt;evaluate the use of the scriptures in the life of the church: in liturgy, spirituality, systematic and pastoral theology &lt;li&gt;articulate the challenges that face the church today in its use of the Bible, including the application of hermeneutical theory to the practice of biblical interpretation, for a range of audiences</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

