<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>TOUR1101</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic introduces and develops the framework of international tourism. It discusses the concepts of tourism best practice, the tourism system, sustainability, integrity and authenticity. It investigates the importance and the impact of tourism socially, environmentally and economically. This topic outlines industry sectors and key organisations, and investigates the concepts of different types of tourism destinations and attractions. The topic covers a range of areas including regional tourism, special interest and niche tourism. This topic also analyses the need for cultural awareness in the context of both delivery and use for both Indigenous and international cultures from a tourism perspective. It also covers the role of governments and media in tourism.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

