ERROR - 2017-10-12 08:58:42 --> <?xml version="1.0" encoding="UTF-8"?>
<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>VISA1001</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic investigates the traditions and theories underlying visual art, and the distinctive artistic styles, visual iconography and practices that arise from these specific traditions. Whilst Western European art traditions and theory will be at the core of the topic, the visual art traditions of Indigenous Australia, China, Japan, India, and the Islamic world will also be introduced and canvassed, as will the socio-cultural foundations of these differing traditions.  The topic will develop the students' skills and knowledge in these areas, as well as developing the critical capacity that is required to research, analyse, debate and write about various visual art traditions, theories and practices, including in some instances, the specific religious or spiritual underpinnings of these traditions. This topic will also enable students to apply such knowledge to their own art making and to critique their own creative artworks, and those of others.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

