ERROR - 2017-10-12 08:58:42 --> <?xml version="1.0" encoding="UTF-8"?>
<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>VISA1001</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>This topic aims to: &lt;ul&gt;&lt;li&gt;introduce students to the major themes, theories and visual practices of several of the world's visual art traditions, of which one will be Western art theory, practice and methodology; &lt;li&gt;accurately identify individual artworks that are typical of at least two of the world's visual art traditions, by placing them within a specific artistic tradition; &lt;li&gt;provide students with the opportunity to analyse visual artworks within their differing visual, social and cultural frameworks and their appropriate historical contexts; &lt;li&gt;provide students with the visual literacy, knowledge, skills and critical capacity to investigate, speak and write about themes and issues around the art traditions and contemporary interpretation of visual artworks&lt;/ul&gt;.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

