ERROR - 2017-10-12 08:58:42 --> <?xml version="1.0" encoding="UTF-8"?>
<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>VISA1001</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>On completion of this topic students will be able to: &lt;ul&gt;&lt;li&gt;demonstrate their understanding of the major themes, theories and  visual practices of at least two of the world's visual art traditions; &lt;li&gt;demonstrate the ability to identify artworks from at least two of the world's visual art  traditions, by accurately placing them within a specific artistic tradition; &lt;li&gt;demonstrate the ability to analyse visual artworks within their differing visual, social and  cultural  frameworks and within their specific historical contexts;  &lt;li&gt;demonstrate their ability to identify and to articulate stylistic differences between visual artworks on the basis of their location within a particular artistic tradition:  &lt;li&gt;demonstrate the requisite knowledge, skills and critical capacity needed to investigate, speak and write about themes and issues around the art traditions and contemporary interpretation, promotion and consumption of  visual artworks; &lt;li&gt;demonstrate their ability to articulate and write clearly about all of the above.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

