<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST1001</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic introduces students to questions of gender and power in everyday life and social institutions in Australian society.  It explores connections between personal experience and social structures, and the changing social position of women. The topic examines issues facing women today such as stereotypes and media images, differences among women, work, violence and families.  It introduces concepts central to women's studies such as the sex/gender distinction; the social construction of difference; and the interrelatedness of gender and power.  The topic will enhance students' oral and written communication skills and provides a valuable introduction to Women's Studies topics at second and third year level.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

