<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST1001</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>The aim of this topic is to introduce some basic concepts of Women's Studies through issues and debates about sex and gender in Australian society.  This involves providing a framework within which to consider:&lt;ul&gt;&lt;li&gt;How ideas about sex and gender are created and circulated in society&lt;li&gt;The diversity of women's experiences in contemporary Australian society formed through race, ethnicity, class and sexuality&lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

