ERROR - 2017-10-12 08:58:51 --> <?xml version="1.0" encoding="UTF-8"?>
<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST1002</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic presents an introduction to contemporary feminist thought, and provides a basis for Women's Studies topics at upper levels. The topic addresses, as its core themes, feminist debates about the nature of gender, the way that gender shapes relations of power, and the ways that gender relations do and might change. The topic surveys a broad range of debates within and about feminism, illustrating and contextualising feminist thought with reference to a number of contemporary issues and debates about the changing circumstances of gender relations in Australia and globally. Critical thought about various strands of feminist theory will be encouraged. The topic will enhance students' oral and written communication skills and provide a useful introduction to Women's Studies topics at Second and Third Year level.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

