<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST1002</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>This topic presents an introduction to contemporary feminist thought, and aims to provide a sound basis for Women's Studies topics at upper levels.  The topic offers opportunities to survey a range of debates within and about feminism, illustrating and contextualising feminist thought with reference to a number of contemporary issues and debates.  The topic addresses, as its core theme, feminist debates concerning equality and difference.  Critical thinking about the relevance and meaning of various strands of feminist theory will be encouraged.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

