ERROR - 2017-10-12 08:58:52 --> <?xml version="1.0" encoding="UTF-8"?>
<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST1002</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>Students must demonstrate their ability to identify, distinguish and evaluate the relevance and usefulness of different feminist approaches.  As they read and research historical and contemporary feminist scholarship, students should develop an informed view of what constitutes feminist thought, and speculate on its effects and potential.  Students should relate readings in feminism to social life more generally, and critically assess the strengths and weaknesses of competing feminist perspectives in their own lives.   This involves demonstrating the ability to structure and focus a coherently critical argument about feminism; finding appropriate sources of scholarly information about feminist thought and using those sources to support the position adopted; promoting and facilitating discussion on issues arising from debates relating to feminism.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

