<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST2012</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic introduces students to Women's Studies, and to questions of gender and power in everyday life. It emphasises three key aspects of women's studies: representations of gender (that is, how we 'see' gender); the inter-relationship of gender with other categories of identity (such as ethnicity, 'race' and sexuality); and the significance of gender in social problems and social problem-solving. Students will encounter and explore key terms and debates in gender studies, and build a platform for extending their knowledge about gender and feminism not just in Women's Studies topics, but in a range of fields.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

