<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST2012</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>After successfully completing this topic students should be able to:&lt;ul&gt;&lt;li&gt;Explain the concepts of gender, sex and identity and use them appropriately within and across disciplinary boundaries&lt;li&gt;Identify and analyse the ways understandings of gender affect power relations in Australian society&lt;li&gt;Identify and analyse the ways race, ethnicity, class and sexuality affect gender identity and experience in Australia&lt;li&gt;Criticise and rebut popular misconceptions about sex/gender&lt;li&gt;Critically analyse a variety of representations, which may include advertisements, film, life stories and academic scholarship&lt;li&gt;Improve their research and communication skills (written and oral) in collaborative, independent, and ethical ways</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

