<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST2013</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>The goal of this topic is to provide you with an overview of the basic concepts operating in feminist theory. It further aims to provide a critical guide to a range of contemporary feminist theory. It provides an introduction to and overview of:&lt;ul&gt; &lt;li&gt;Debates within feminist thought&lt;li&gt;The ways feminist theory can explain and/or complicate our understanding of gender relations&lt;li&gt;The different visions, aims and strategies of the many strands making up feminism&lt;li&gt;Feminism and Women's Studies as a field ofknowledge</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

