<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST2013</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>After successfully completing this topic you should:&lt;ul&gt;&lt;li&gt;Be able to distinguish a number of feminist approaches to a range of social problems and issues&lt;li&gt;Have developed the skills and confidence to relate readings in feminism to your own experience and to social life more generally&lt;li&gt;Be able to critically assess the strengths and weaknesses of competing feminist perspectives on a range of issues &lt;ul&gt;In the process you should also: &lt;li&gt;Improve your ability to think critically and form independent judgements&lt;li&gt;Improve your written and verbal communication skills&lt;li&gt;Improve your research skills&lt;li&gt;Gain confidence in your ability to analyse issues and ideas</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

