<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST2014</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>The topic will critically explore representations of gender, race and sexuality in a number of media and popular culture genres. It will investigate the ways that interaction with media both reproduces and challenges existing social and cultural relations of power. Students will be introduced to contemporary approaches to analysing the production of media, the interpretation of media texts by audiences and the multiple meanings that all media texts embody, in relation to the formation of cultural identities. Students will have the opportunity to develop specific skills in media analysis and will undertake collaborative research projects.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

