<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST2016</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic engages student with the voices and perspectives of Indigenous women in Australian society, exploring some of their many struggles and achievements across a variety of fields. It takes a history of colonialism as its starting point and investigates how ideas about and practices of race, interwoven with gender, shape the lives of Indigenous and Non-Indigenous people. In this context the topic will introduce the idea of whiteness as a racial category and will raise questions about the relationship of feminist theory, as a non-Indigenous conceptual framework, to the lives of Indigenous women. The scholarly writing and creative work of Indigenous women form the basis for investigation of a range of issues and for student research and exploration. The topic stresses the differences as well as commonalities among Indigenous women in Australia and will also make reference to Indigenous women in other countries.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

