<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST2016</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>The topic aims to critically engage students with the voices and perspectives of Indigenous women in Australia. Students will critically assess the ethics and relevance of non-Indigenous conceptual frameworks as the basis for engaging with Indigenous women. Students will work both collaboratively and independently to explore the lives and scholarly and creative work of Indigenous women and their own positions in relation to Indigenous women. The topic aims to develop students' oral presentation skills, independently and in collaboration with others.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

