ERROR - 2017-10-12 08:58:53 --> <?xml version="1.0" encoding="UTF-8"?>
<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST2017</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>The aim of this topic is to offer an introduction to some of the principal issues related to the question of gender and development in what are called 'Third World' countries and will focus on Africa, Asia, Latin America and the Middle East. The comparative experiences of non-western women will be taken in to account at various stages of this topic. The topic will explore empirical studies of women's lives contemporary 'Third World' and the theoretical perspectives which have been used to elucidate specific aspects of those lives. The underlying goal will be to understand the relationship between development and gender relations in different developing societies.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

