<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST2017</ns1:in1><ns1:in2>learning_outcomes</ns1:in2><ns1:in3>On successful completion of this topic students should be able to:&lt;ul&gt;&lt;li&gt;critically evaluate the principal theories/modes of explanation for considering difference and gender  development issues in the contemporary world&lt;li&gt;research gender issues in relation to international development/contemporary development practice and present findings verbally and in written form, in accordance with good scholarly practice&lt;li&gt;identify/demonstrate ways non-western women are disempowered in culturally specific social, economic and political circumstances both within their own countries and beyond national borders</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

