<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST3009</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>The topic aims to offer students the opportunity to consider how ideas about, and practices of, sexuality shape their personal lives and the world around them. It aims to equip students with an ethical vocabulary that embodies respect for sexual diversity and sexual rights for understanding and communicating about sexuality issues. It fosters independent thinking about sexuality as well respectful collaborative endeavours to discuss problems and formulate solutions. It encourages students to think critically about the ways that ideas and practices of sexuality have created and ordered differences between people so as to privilege some and disadvantage others.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

