ERROR - 2017-10-12 08:58:55 --> <?xml version="1.0" encoding="UTF-8"?>
<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST3010</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>The traditions of (white-western) philosophy and social theory usually focus on the mind: to borrow from Descartes, 'we think, therefore we are'. But what happens if we switch attention to the body? How does our bodily experience influence our construction of knowledge, power and theory? This topic surveys a number of influential feminist theorists of the body and examines their contribution to ideas and practices in women's studies. The emphasis is on understanding various theories about gender, subjectivity and power that underpin different points of view on topics such as eating disorders, surgical modifications, sexualities, and more. It examines difference in two senses: sexual difference (that is, differences in men and women's corporeal experience); but also differences within the categories of 'women' and 'men' (incorporating other differences such as 'race', ethnicity, age, sexuality, and class). It is interdisciplinary, drawing from feminist philosophy, sociologies of the body, and cultural studies.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

