<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST7022</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This interdisciplinary topic offers students at Honours level the opportunity to become familiar with contemporary critical analyses of popular culture. The focus is on the representation of gender, race and sexuality across a broad range of media forms including television, film, magazines, news media, computer gaming and advertising in all its varieties. The topic also addresses the ways in which audiences make use of and negotiate their identities through popular culture. It addresses some key debates about the politics of gender, race and sexuality in relation to popular culture. It adopts feminist and related critical approaches as its foundation.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

