<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST7030B</ns1:in1><ns1:in2>educ_aims</ns1:in2><ns1:in3>The thesis element in the Women's Studies Honours program is intended to: &lt;ul&gt; &lt;li&gt;Give a student scope to develop a special research interest under the supervision of an individual staff member&lt;li&gt;Apply feminist and/or related theories to a gender issue in an extended and sustained way&lt;li&gt;Provide the chance to enhance research skills to an extent not possible earlier in the degree, by working in an intensive way and reading widely on a particular gender issue&lt;li&gt;Enable a student to show originality inthe writing of an extended piece of argument (15 to 18,000 words long)&lt;li&gt;Develop writing skills as appropriate for an extended piece of work&lt;li&gt;Adequately prepare students for postgraduate work &lt;/ul&gt;</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

