<SOAP-ENV:Envelope xmlns:SOAP-ENV="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ns1="http://taxonomy.core.tle.com"><SOAP-ENV:Body><ns1:setData><ns1:in0>53ff320d-c227-4224-862a-bfdba4176bc0</ns1:in0><ns1:in1>WMST8003</ns1:in1><ns1:in2>topic_description</ns1:in2><ns1:in3>This topic offers an introduction to some of the principal issues related to the question of gender and development in what are termed 'Third World' countries. The topic will cover the geographical regions of Africa, Asia, Latin America and the Middle East and the comparative experiences of women will be taken into account at various stages of the topic. It will explore empirical studies of women's lives in the contemporary developing world and the theoretical perspectives which have been used to elucidate specific aspects of their lives. The underlying goal will be to understand the relationship between development and gender relations in different developing societies.</ns1:in3></ns1:setData></SOAP-ENV:Body></SOAP-ENV:Envelope>

